{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/noahice/bellabeat-case-study-r?scriptVersionId=159375540\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"6c04b68f","metadata":{"papermill":{"duration":0.00844,"end_time":"2024-01-17T20:33:58.360983","exception":false,"start_time":"2024-01-17T20:33:58.352543","status":"completed"},"tags":[]},"source":["## **Introduction**\n","\n","This case study is for the Google & Coursera Data Analytics Certificate. Bellabeat is a high-tech manufacture of fitness devices for women. The primary focus of these devices are to track and give analysis on sleep, fitness, and other health related patterns.\n","\n","Some of these primary products include:\n","* Bellabeat App - Connects to other Bellabeat devices to provide users information on their health, sleep cycles, fitness, mindfulness habits, and more. \n","* Leaf - This is a wellness tracker that can be worn as a bracelet, necklace, or clip. This is the classic fitness device in the Bellabeat line.\n","* Time - This wellness watch combines the aesthetic as a natural timepiece while having the smart technology capabilities to track users sleep patterns, steps, and stress. Connects to the Bellabeat App to give insights to your wellness.\n","* Spring - This is a water bottle that tracks your daily water intake using smart technology to ensure you are appropriately hydrated throughout the day. The bottle also connects to the Bellabeat App.\n","* Bellabeat membership: Bellabeat also offers a subscription-based membership program for users. Membership gives users 24/7 access to fully personalized guidance on nutrition, activity, sleep, health and beauty, and mindfulness based on their lifestyle and goals."]},{"cell_type":"markdown","id":"fddca94e","metadata":{"papermill":{"duration":0.007588,"end_time":"2024-01-17T20:33:58.37638","exception":false,"start_time":"2024-01-17T20:33:58.368792","status":"completed"},"tags":[]},"source":["## **Stakeholders**\n","\n","* Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","* Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","* Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and reporting data that helps guide Bellabeat’s marketing strategy. "]},{"cell_type":"markdown","id":"cdb25c2c","metadata":{"papermill":{"duration":0.007476,"end_time":"2024-01-17T20:33:58.391522","exception":false,"start_time":"2024-01-17T20:33:58.384046","status":"completed"},"tags":[]},"source":["## **More About the Company**\n","\n","Urška Sršen and Sando Mur founded Bellabeat, a high-tech company that manufactures health-focused smart products. Sršen used her background as an artist to develop beautifully designed technology that informs and inspires women around the\n","world. Collecting data on activity, sleep, stress, and reproductive health has allowed Bellabeat to empower women with knowledge about their own health and habits. Since it was founded in 2013, Bellabeat has grown rapidly and quickly positioned itself as a tech-driven wellness company for women."]},{"cell_type":"markdown","id":"f9c119bd","metadata":{"papermill":{"duration":0.008023,"end_time":"2024-01-17T20:33:58.40705","exception":false,"start_time":"2024-01-17T20:33:58.399027","status":"completed"},"tags":[]},"source":["## **Business Task**\n","\n","I was given data from FitBit Fitness Trackers made available through Kaggle. I was tasked with cleaning and analyzing this data to help the marketing team on Bellabeat make decisions moving forward. This data set was created between 03/12/2016-05/12/2016 and contains personal fitness tracker from thirty fitbit users. \n","\n","*Questions to Consider during the analysis*\n","\n","1. What are some trends in smart device usage?\n","2. How could these trends apply to Bellabeat customers?\n","3. How could these trends help influence Bellabeat marketing strategy?"]},{"cell_type":"markdown","id":"b3ea1698","metadata":{"papermill":{"duration":0.00771,"end_time":"2024-01-17T20:33:58.42224","exception":false,"start_time":"2024-01-17T20:33:58.41453","status":"completed"},"tags":[]},"source":["## **Analysis**"]},{"cell_type":"code","execution_count":1,"id":"cc4e588a","metadata":{"execution":{"iopub.execute_input":"2024-01-17T20:33:58.441518Z","iopub.status.busy":"2024-01-17T20:33:58.439419Z","iopub.status.idle":"2024-01-17T20:33:59.596126Z","shell.execute_reply":"2024-01-17T20:33:59.594148Z"},"papermill":{"duration":1.168787,"end_time":"2024-01-17T20:33:59.598606","exception":false,"start_time":"2024-01-17T20:33:58.429819","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.1\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.4     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.3     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.2     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u