nih.gov/pmc/articles/PMC4434546/) posted around the recommended amount of sleep in adults. They recommend around 7 hours, with less than 7 hours attributing to adverse health outcomes, and over 9 hours promoting health risks as well. The Bellabeat marketing team can use this information to distribute recommendations to its users, who have particular fitness goals, that could be potentially recording not enough sleep, to the users who are getting too much sleep.\n","\n","2. When analyzing the data, it can also be assumed that some users were not wearing their devices throughout all times of the day -- meaning that the varying levels in abnormally low sleep recorded and abnormally low calories recorded. The Bellabeat marketing team can leverage this by giving recommendations to its own users with direct weight loss, sleep monitoring, or other wellness goals to increase their usage in the Bellabeat devices in order to receive the most accurate recommendations per user in whichever category they fit into. This information can be used to remind users to aim for specific varying targets of wellness that include - how many hours of sleep each user should aim for in comparison to their daily water intake, calories burned, and steps taken, to ensure the peak well-being for women with specific goals in their daily lives. "]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":1041311,"sourceId":1752235,"sourceType":"datasetVersion"}],"isGpuEnabled":false,"isInternetEnabled":false,"language":"r","sourceType":"notebook"},"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":9.961865,"end_time":"2024-01-17T20:34:05.018805","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"202